import { useState } from 'react';
import { getProductos } from '../services/api';

function Home() {
	const listaProductos = async (e) => {
		e.preventDefault();
		const res = await getProductos;
	};
	const crearProducto = listaProductos.map((producto) => 
		<li key={producto.id}>
			{producto.name}
		</li>
	);
	return (
		<h2>
		  Hello
		</h2>
	);
}

export default Home;
